  <JobListingsView jobs={jobs} />
)

export default JobListings

JobListings.getInitialProps = async () => {
  const response = await fetch(`${process.env.API_ROOT}/jobs/`)
  const { data: jobs } = await response.json()

  console.log({ jobs })

  return { jobs }
}
